// SPDX-License-Identifier: MIT
pragma solidity <0.6.0;

contract RecordContract {

    modifier onlyOwner(){
        require(owner == msg.sender, "CA authenication failed");
        _;
    }
    modifier onlyAG(address _AG){
        require(isAGExist(_AG), "AG hasn't registered yet");
        _;
    }



    address public owner;
    address[] public agList; // 記錄所有AG位位址
    mapping(address=>AG) public agStructList; // 紀錄各個AG資訊
    mapping(address => bool) public agExistList;  // 紀錄AG是否存在


    constructor() public {
        owner = msg.sender;
    }

    struct AG{
        mapping(address => bool)clientExistList;
        mapping(address=> uint256[2]) clientCHash;
        address[] clientList;
        address selfAddress;
        string domain;
        uint256 Knx;
        uint256 Kny;
    }

    // check if AG exists in CA
    function isAGExist(address _AG) public view returns(bool) {
        return agExistList[_AG];
    }

    // 取得AG公鑰
    function getAGPublicKey(address _AG) public view returns(uint256, uint256){
        return (agStructList[_AG].Knx, agStructList[_AG].Kny);
    }
    // 取得特定Client的CHash
    function getClientCHameleonHash(address _AG, address _client) public view returns(uint256, uint256){
        return (agStructList[_AG].clientCHash[_client][0], agStructList[_AG].clientCHash[_client][1]);
    }

    // 登記 AG 由CA負責登記
    function registerAG(address _AG, string memory domain, uint256 _Knx, uint256 _Kny) public onlyOwner returns(bool){
        agStructList[_AG].selfAddress = _AG;
        agStructList[_AG].domain = domain;
        agStructList[_AG].Knx = _Knx;
        agStructList[_AG].Kny = _Kny;
        agList.push(_AG);
        agExistList[_AG]=true;

        return true;
    }


    // AG登記Client 由AG自行登記
    function registerClient(address client, uint256 CHashX, uint CHashY) public onlyAG(msg.sender) returns(bool){
        //
        agStructList[msg.sender].clientExistList[client] = true;
        agStructList[msg.sender].clientList.push(client);

        agStructList[msg.sender].clientCHash[client][0]= CHashX;
        agStructList[msg.sender].clientCHash[client][1]= CHashY;

        return true;
    }


    // 透過Client address 找尋 AG， 由發送方的AG執行
    function findAGviaAddress(address client) public view returns(address) {
        //
        for(uint i=0;i<agList.length;i++) {
            if(agStructList[agList[i]].clientExistList[client])
                return agList[i];
        }
        return address(0);
    }

    function removeClient(address client) public onlyAG(msg.sender) returns(bool){
        // 設定為否
        agStructList[msg.sender].clientExistList[client] = false;

        uint arrayLen = agStructList[msg.sender].clientList.length;
        // 找此用戶在陣列中的index
        // 把最後一項與曜刪除的那一項對調後再做pop
        for (uint i; i<arrayLen; i++){
            if (agStructList[msg.sender].clientList[i] == client){
                address tmp = agStructList[msg.sender].clientList[i];
                agStructList[msg.sender].clientList[i] = agStructList[msg.sender].clientList[arrayLen-1];
                agStructList[msg.sender].clientList[arrayLen-1] = tmp;
                break;
            }
        }
        agStructList[msg.sender].clientList.pop();


        return true;
    }
}
